import { backendAPI } from '@instinct-web/core';
export class LawServiceImplementation {
  async getAll() {
    const laws = await backendAPI.get('laws');
    return laws.data;
  }

  async create(lawDTO) {
    const newLaw = await backendAPI.post('laws', lawDTO);
    return newLaw.data;
  }

  async updateByID(lawID, lawDTO) {
    const newLaw = await backendAPI.patch(`laws/${lawID}`, lawDTO);
    return newLaw.data;
  }

  async deleteByID(lawID) {
    await backendAPI.delete(`laws/${lawID}`);
  }

}
